//script to find if newly created customer is added in the customer list
import com.eviware.soapui.support.XmlHolder
def tc=testRunner.testCase.testSuite.project.testSuites['CustomerRepositoryFunctionalTesting'].testCases['PropertyAndPropertyTransfer']
def ts=tc.testSteps['Get Customer List'].getPropertyValue('response')

def holder=new XmlHolder(ts)
def nodecount=holder.getNodeValue("count(//result/items/item/email)")
log.info "$nodecount"

def emailFromList=context.expand('${Get Customer List#response#//*:result/items/item['+nodecount+']/email}')
log.info "$emailFromList"
def newemail=context.expand('${Properties#email}')
log.info "$newemail"
assert emailFromList==newemail
log.info "Created customer is added in the customer list"

