import jxl.*
import com.eviware.soapui.support.XmlHolder
def sku,name,price
def filepath="C:\\Users\\SuprajaKoganti\\Desktop\\Soap Project\\Products.xls"
File myfile=new File(filepath)
Workbook wb=Workbook.getWorkbook(myfile)
Sheet sh=wb.getSheet("Sheet1")

def row=sh.getRows().toInteger()
log.info row
def column=sh.getColumns().toInteger()
for(def i=1;i<row;i++)
{
		for(def j=0;j<column;j++)
		{
			if(j==0)
			{
				sku=sh.getCell(j,i).getContents()
				log.info "$sku"

			}
			else if(j==1)
			{
				name=sh.getCell(j,i).getContents()
				log.info "$name"
			}
			else
			{
				price=sh.getCell(j,i).getContents()
				log.info "$price"
			}

		}
	def tc1 = testRunner.testCase.testSuite.project.testSuites["Product Repository Data Driven Testing"].testCases["TestCase 1"]
	tc1.testSteps["product"].setPropertyValue("sku",sku)
	tc1.testSteps["product"].setPropertyValue("name",name)
	tc1.testSteps["product"].setPropertyValue("price",price)
	tc1.run(null,false)
}

