import com.eviware.soapui.support.XmlHolder
def jdbcresponse=context.testCase.testSteps['JDBC Request'].getPropertyValue("responseAsXml")
log.info jdbcresponse
def holder=new XmlHolder(jdbcresponse)
def nodecount=holder.getNodeValue("count(//ResultSet/Row)")
log.info nodecount
for(def i=1;i<=nodecount.toInteger();i++)
{
	def customerEmail=holder.getNodeValue("//Results/ResultSet/Row["+i+"]/ORDERSLIST.CUSTOMEREMAIL")
	def sku=holder.getNodeValue("//Results/ResultSet/Row["+i+"]/ORDERSLIST.SKU")
	def productId=holder.getNodeValue("//Results/ResultSet/Row["+i+"]/ORDERSLIST.PRODUCTID")
	def qtyOrdered=holder.getNodeValue("//Results/ResultSet/Row["+i+"]/ORDERSLIST.QTYORDERED")
	def price=holder.getNodeValue("//Results/ResultSet/Row["+i+"]/ORDERSLIST.PRICE")
	log.info "$customerEmail - $sku - $productId - $qtyOrdered - $price"
def tc1 = testRunner.testCase.testSuite.project.testSuites["Order Repository Database Testing"].testCases["Database Testing with JDBC"]
	tc1.testSteps["Order Properties"].setPropertyValue("customerEmail",customerEmail)
	tc1.testSteps["Order Properties"].setPropertyValue("sku",sku)
	tc1.testSteps["Order Properties"].setPropertyValue("productId",productId)
	tc1.testSteps["Order Properties"].setPropertyValue("qtyOrdered",qtyOrdered)
	tc1.testSteps["Order Properties"].setPropertyValue("price",price)
	def runner=tc1.run(null,false)

	log.info "$runner.status"
	log.info "$runner.timeTaken"
	log.info runner.results.size()
}

